// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import RestaurantList from './components/RestaurantList';
import RestaurantDetail from './components/RestaurantDetail';
import PizzaList from './components/PizzaList';
import RestaurantPizzaForm from './components/RestaurantPizzaForm';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/pizzas">Pizza List</Link>
            </li>
            <li>
              <Link to="/create">Create Restaurant Pizza</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/pizzas" component={PizzaList} />
          <Route path="/create" component={RestaurantPizzaForm} />
          <Route path="/restaurants/:id" component={RestaurantDetail} />
          <Route path="/" component={RestaurantList} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
